If altitude $CD$ is $\sqrt3$ centimeters, what is the number of square centimeters in the area of $\Delta ABC$?

[asy] import olympiad; pair A,B,C,D; A = (0,sqrt(3)); B = (1,0);
C = foot(A,B,-B); D = foot(C,A,B); draw(A--B--C--A); draw(C--D,dashed);
label("$30^{\circ}$",A-(0.05,0.4),E);
label("$A$",A,N);label("$B$",B,E);label("$C$",C,W);label("$D$",D,NE);
draw((0,.1)--(.1,.1)--(.1,0)); draw(D + .1*dir(210)--D + sqrt(2)*.1*dir(165)--D+.1*dir(120));
[/asy]

Steve has an isosceles triangle with base 8 inches and height 10 inches. He wants to cut it into eight pieces that have equal areas, as shown below. To the nearest hundredth of an inch what is the number of inches in the greatest perimeter among the eight pieces? [asy]
size(150);
defaultpen(linewidth(0.7));
draw((0,0)--(8,0));
for(int i = 0; i < 9; ++i){
draw((4,10)--(i,0));
}
draw((0,-0.5)--(8,-0.5),Bars(5));
label("$8''$",(0,-0.5)--(8,-0.5),S);
[/asy]
